import React, { Fragment } from "react";
import { Switch, Route, Link } from "react-router-dom";
import styled from "styled-components";
import AddTodo from "./AddTodo";
import TodoList from "./EditTodo";
import "../App.css";

const Nabvar = styled.nav`
  background: #dbfffe;
  minheight: 8vh;
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

const Logo = styled.div`
  font-wight: bold;
  font-size: 23px;
  letter-spacing: 3px;
`;

const NavItems = styled.ul`
  display: flex;
  width: 400px;
  max-width: 40%;
  justify-content: space-around;
  list-style: none;
`;

const NavItem = styled.li`
  font-size: 19px;
  font-weight: bold;
  opacity: 0.7;
  $:hover {
    opacity: 1;
  }
`;

export const Index = () => {
  return <>Todo一覧</>;
};
